 @joseaugsto8361  Acredito que a principal diferença entre os dois é que o Flamengo costuma jogar com a posse de bola no campo de ataque do adversário e expõe muito a defesa pois adianta muito o time. Já o Atlético, como você mesmo disse, tem um time mais equilibrado, não adianta tanto o time e não deixa a defesa tão exposta. O Flamengo faz mais gols pq se arrisca mais no ataque (Tem o melhor ataque do brasileiro e da libertadores) já o Galo se arrisca menos. O Cuca sabe muito bem gerir equipes assim. 
Contra o Flamengo o Galo sempre joga no contra ataque se aproveitando dos espaços que o Flamengo deixa e tem se dado bem nos últimos anos principalmente no ano passado. 
Porém a defesa do Flamengo vem melhorando a cada jogo quando os dois forem se enfretar novamente será um jogo muito bom e muito mais equilibrado.

